import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const MyAdsPage = () => {
  return (
    <View>
      <Text>MyAdsPage</Text>
    </View>
  )
}



const styles = StyleSheet.create({})

export default MyAdsPage
